import React from 'react';
import axios from 'axios';

export default class PersonList extends React.Component {
  state = {
    persons: []
  }

  componentDidMount() {
    axios.get(`https://api.jsonserve.com/1ekkzf`)
      .then(res => {
        const persons = res.data;
        this.setState({ persons });
      })
  }

  render() {
    return (
		<tbody>
        {
          this.state.persons
		  .map((info)=>(
			<tr key={info.id}>
				<td>{info.id}</td>
				<td>{info.name}</td>
				<td>{info.city}</td>
			</tr>
            ))
        }
		</tbody>
    )
  }
}
